import React, { useEffect, useState } from 'react';
import logo from './logo.svg';
import './App.css';
import getCompanies from './api/getCompanies';
import { CompanyType } from './types';

function App() {
  const [companies, setCompanies] = useState<CompanyType[]>([])
  const [currentPage, setCurrentPage] = useState<number>(0)
  const [companiesToDisplay, setCompaniesToDisplay] = useState<CompanyType[]>([])
  let pageCounts = Math.ceil(companies.length /10)

  const fetchCompanies = async() => {
    const comp: any = await getCompanies()
    setCompanies(comp)
  }

  const handlePageChange = (nextPage: number) => {
    setCurrentPage(nextPage)
  }

  useEffect(() => {
    fetchCompanies()
  }, [])



  useEffect(() => {
  //  console.log('companies::::::', companies);
   const copyOfComp = companies
   var arrays = [], size = 10;


  ;
   while(copyOfComp.length > 0) {
    arrays.push(copyOfComp.splice(0, size))
   }
   console.log('arrays::::::', arrays);
    let comp = companies.slice(0,10)
    switch(currentPage) {
      case 1:
        comp = companies.slice(0,9)
        break;
      case 2: 
        comp = companies.slice(10,19)
        break
      case 3: 
        comp = companies.slice(20,29)
        break
      case 4: 
        comp = companies.slice(30,39)
        break
      case 5: 
        comp = companies.slice(40,49)
        break
      case 6: 
        comp = companies.slice(50,59)
        break
      case 7: 
        comp = companies.slice(60,69)
        break
      case 8: 
        comp = companies.slice(70,79)
        break
      case 9: 
        comp = companies.slice(80,89)
        break
      case 10: 
        comp = companies.slice(90,99)
        break
      case 11: 
        comp = companies.slice(100,109)
        break
      case 12: 
        comp = companies.slice(110,119)
        break
      case 13: 
        comp = companies.slice(120,129)
        break
      case 14: 
        comp = companies.slice(130,139)
        break
      case 15: 
        comp = companies.slice(140,159)
        break
      case 16: 
        comp = companies.slice(150,159)
        break
      case 17: 
        comp = companies.slice(160,169)
        break
      case 18: 
        comp = companies.slice(170,179)
        break
      case 19: 
        comp = companies.slice(180,189)
        break
      case 20: 
        comp = companies.slice(190,199)
        break
    }
    setCompaniesToDisplay(comp)
  }, [currentPage])

  return (
    <div>
      <header>

      </header>
      <section>
        <table>
          <thead>
          <tr>
            <th>id</th>
            <th>Name</th>
            <th>Description</th>
            <th>Website</th>
          </tr>
          </thead>
          <tbody>
          {companiesToDisplay.slice(0,10).map(c => {
            return <tr key={c.id}>
            <td>{c.id}</td>
            <td>{c.name}</td>
            <td>{c.description}</td>
            <td>{c.website}</td>
            </tr>
          })}
          </tbody>
        </table>
        <div>
          <button disabled={currentPage === 1} onClick={() => handlePageChange(currentPage - 1)}>Prev</button>
          <button onClick={() => handlePageChange(1)}>1</button>
          <button onClick={() => handlePageChange(2)}>2</button>
          <button onClick={() => handlePageChange(3)}>3</button>
          <span>...</span>
          <button disabled={currentPage === 20} onClick={() => handlePageChange(currentPage + 1)}>Next</button>
        </div>
        {/* <ul>
          {companies.slice(0,10).map(c => {
            return <div key={c.id}>
            <p>{c.name}</p>
            </div>
          })}
        </ul> */}
      </section>
    </div>
  );
}

export default App;
